  false,\n\t\"url\": null,\n\t\"notes\": \"The Parking Regulations are drawn from
  DOTu2019s traffic sign database, STATUS, which is used by DOT in managing its inventory
  of over one million traffic signs in New York City. The database keeps track of
  the description, location and installation dates for DOT traffic signs. The Locations
  and Signs datasets need to be used in combination. The data in files can be linked,
  to find an applicable regulation, using the 'StatusOrderNumber' value. This process
  is automated at our  DOT Parking Regulation website: http://a841-dotvweb01.nyc.gov/ParkingRegs/ViewController/LocationValidation.aspxrnrnClick
